const Assigned=()=> {
    return(
        <>
        <div className='header'>
                <a onClick={logout}><ExitToApp style={{ float: 'right', margin: '10px', color: '#203e57', width: '50px', height: '50px' }} /></a>
                <h1 className='hello'>Hello, {studentName}</h1>
            </div>
        </>
    );
}
export default Assigned;
